deck_description:
Side decks your choice.  Im still fairly new to this game so if you can tell me in the chat what to fix or give feedback.  This deck has acctually been working fairly decent for me in the online community, ive beaten a good amount of meta decks. i also organized this deck so its easier to people to see.

&nbsp;

Eldlich is pretty simple to use, the traps and spells recycle each other for the other archetype, the golden lands banish themselves to set a edlixir, the edlixir banishes itself to set a golden land.

This deck hopefully will be community built.

what i mean by that is that tell me what to fix in chat, the people in chat will help make the deck. but if you tell me what card to add, or cut. give me a reason so that i dont cut/add something for no reason.

&nbsp;

I am still fairly new to the game and play online so i dont do any of those budget decks since the stuff online is free for me.

&nbsp;

So if ive made a stupid mistake let me know, for example i have no idea what master rule 5 is.

&nbsp;

And yeah lets make this deck good so people on this website can see a good deck. instead of those decks that are illegal or are just plain garbage.

So after 2 years, 4 months and 21 days, I've been able to complete my dream deck which has been the Mayakashi archetype ever since Hidden Summoners had first been released back in November 16th. So when comparing the previous builds of the deck from my old account: Kyo Saisto and making adjustments to the deck to suit its playstyle, I am currently running a Zombie world engine with Doomking Balderoch and having it combo with Yuki-Onna, the Absolute Zero Mayakashi can make the two become a threat on the field with 3 negates and a way of banishing a card from either the field or GY. I am also making use of the Shiranui support line with cards such as Shiranui Squire and Shiranui SpectralSword Shade to then go into Shiranui Squiresaga and then further extend with the spell card Ghost Meets Girl - A Mayakashi Manuscript to further synchro summon into Shiranui Sunsaga which then can help wiping the board whilst at the same time recycling your extra deck. As per usual when playing Mayakashi, it is important to climb from level 3 to level 11 with the use of Hajun when summoned can speacial summon out another Mayakashi monster such as Dakki to start the synchro climb and cards like Yuki-Musume, the Ice Mayakashi can act as a foolish burial of the deck as it allows you to dump a zombie monster to the GY such as Necroworld Banshee, Glow-up Bloom and Mezuki are key cards that can help setup for more GY plays. For handtraps I've managed to add cards like Ash Blossom &amp; Ghost Ogre to help put a stop to my opponents plays.

&nbsp;

For the side deck, I have Ghost Belle &amp; Haunted Mansion reserved, Ghost Reaper for a generic level 3 Tuner, Another copy of Burial from a different Dimension for being able to recycle cards such as Mezuki back into the graveyard, one copy of book of life as well as a copy of Fateful Hour to act as monster reborns and lastly Magic cylinder and I know not many people these days don't really play this card in their deck but its pretty useful for a rather more defensive play.

&nbsp;

Feel free to leave some of your feedbacks about the deck down below and I would love to hear your guys advice on how I can improve the deck as one day I would love to play in my first locals/event.
